import React, { useState } from "react";
import * as Yup from "yup";
import { Form, Input } from "@rocketseat/unform";
import Axios from "axios";
import Cardd from "../components/Card";
import "./index.css";

import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";

import logo from "./assets/logo@3x.png";
import relogio from "./assets/relogio.png";
import baloes from "./assets/baloes.png";

const schema = Yup.object().shape({
  Nome: Yup.string().required("Nome é obrigatorio"),
  Mail: Yup.string().required("E-mail Obrigatorio"),
  Mensagem: Yup.string().required("Mensagem é obrigatorio"),
});

export default function Card() {
  return (
    <div>
      <nav className='corlogo'>
        <div>
          <img src={logo} alt='logo' className='logo' />

          <button className='botao'>Inicio</button>
          <button>Sobre</button>
          <button>Serviços</button>
          <button>Contato</button>
        </div>
      </nav>

      <Cardd />

      <footer>
        <div className='footer'>© 2021 Guepardo Transportes</div>
      </footer>
    </div>
  );
}
